DROP TABLE IF EXISTS `trust_ledger`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `trust_ledger` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `account_id` int(10) unsigned NOT NULL COMMENT 'IOLTA/Trust bank account',
  `client_id` int(10) unsigned NOT NULL,
  `current_balance` decimal(15,2) DEFAULT 0.00,
  `minimum_balance` decimal(15,2) DEFAULT 0.00 COMMENT 'Alert if below this',
  `is_active` tinyint(1) DEFAULT 1,
  `opened_at` date DEFAULT NULL,
  `closed_at` date DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`),
  UNIQUE KEY `uk_trust_ledger_client` (`account_id`,`client_id`),
  KEY `idx_trust_ledger_user` (`user_id`),
  KEY `idx_trust_ledger_balance` (`current_balance`),
  KEY `fk_trust_ledger_client` (`client_id`),
  CONSTRAINT `fk_trust_ledger_account` FOREIGN KEY (`account_id`) REFERENCES `accounts` (`id`) ON DELETE CASCADE,
  CONSTRAINT `fk_trust_ledger_client` FOREIGN KEY (`client_id`) REFERENCES `trust_clients` (`id`) ON DELETE CASCADE,
  CONSTRAINT `fk_trust_ledger_user` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=518 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
