--
-- Table structure for table `trust_transactions`
--

DROP TABLE IF EXISTS `trust_transactions`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `trust_transactions` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `ledger_id` int(10) unsigned NOT NULL,
  `transaction_id` int(10) unsigned DEFAULT NULL COMMENT 'Link to main bank transaction',
  `staging_id` int(10) unsigned DEFAULT NULL COMMENT 'Source staging record',
  `is_posted` tinyint(1) DEFAULT 1 COMMENT 'True if affects account balance',
  `transaction_type` enum('deposit','disbursement','transfer_in','transfer_out','earned_fee','refund','interest','adjustment','payout','legal_fee') NOT NULL,
  `amount` decimal(15,2) NOT NULL COMMENT 'Positive for deposits, negative for withdrawals',
  `running_balance` decimal(15,2) NOT NULL COMMENT 'Balance after this transaction',
  `description` varchar(500) NOT NULL,
  `payee` varchar(200) DEFAULT NULL COMMENT 'For disbursements',
  `received_from` varchar(200) DEFAULT NULL,
  `reference_number` varchar(50) DEFAULT NULL COMMENT 'Check number, wire reference, etc.',
  `check_number` varchar(20) DEFAULT NULL,
  `status` enum('pending','printed','cleared','void') NOT NULL DEFAULT 'pending',
  `transaction_date` date NOT NULL,
  `cleared_date` date DEFAULT NULL,
  `memo` text DEFAULT NULL,
  `related_transaction_id` int(10) unsigned DEFAULT NULL COMMENT 'For transfers between ledgers',
  `created_by` int(10) unsigned DEFAULT NULL COMMENT 'User who created this entry',
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `entity_id` int(10) unsigned DEFAULT NULL,
  `case_id` int(10) unsigned DEFAULT NULL,
  `category_id` int(10) unsigned DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_trust_trans_ledger` (`ledger_id`),
  KEY `idx_trust_trans_date` (`transaction_date`),
  KEY `idx_trust_trans_type` (`transaction_type`),
  KEY `idx_trust_trans_transaction` (`transaction_id`),
  KEY `fk_trust_trans_user` (`user_id`),
  CONSTRAINT `fk_trust_trans_ledger` FOREIGN KEY (`ledger_id`) REFERENCES `trust_ledger` (`id`) ON DELETE CASCADE,
  CONSTRAINT `fk_trust_trans_transaction` FOREIGN KEY (`transaction_id`) REFERENCES `transactions` (`id`) ON DELETE SET NULL,
  CONSTRAINT `fk_trust_trans_user` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=3911 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

