--
-- Table structure for table `trust_staging`
--

DROP TABLE IF EXISTS `trust_staging`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `trust_staging` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(10) unsigned NOT NULL,
  `account_id` int(10) unsigned NOT NULL COMMENT 'IOLTA bank account',
  `transaction_date` date NOT NULL,
  `transaction_type` enum('deposit','check','transfer','fee','other') NOT NULL DEFAULT 'other',
  `amount` decimal(15,2) NOT NULL COMMENT 'Positive for deposits, negative for withdrawals',
  `description` varchar(500) NOT NULL,
  `reference_number` varchar(50) DEFAULT NULL COMMENT 'Check number, wire reference',
  `payee` varchar(200) DEFAULT NULL,
  `memo` text DEFAULT NULL,
  `original_csv_row` longtext CHARACTER SET utf8mb4 COLLATE utf8mb4_bin DEFAULT NULL COMMENT 'Original row data from CSV' CHECK (json_valid(`original_csv_row`)),
  `import_batch_id` varchar(50) DEFAULT NULL COMMENT 'Batch ID for grouping imports',
  `csv_row_number` int(11) DEFAULT NULL,
  `status` enum('unassigned','assigned','posted','rejected','reconciled') NOT NULL DEFAULT 'unassigned',
  `client_id` int(10) unsigned DEFAULT NULL COMMENT 'Assigned client/case',
  `assigned_at` timestamp NULL DEFAULT NULL,
  `assigned_by` int(10) unsigned DEFAULT NULL,
  `posted_at` timestamp NULL DEFAULT NULL,
  `posted_by` int(10) unsigned DEFAULT NULL,
  `posted_transaction_id` int(10) unsigned DEFAULT NULL COMMENT 'Link to trust_transactions after posting',
  `rejected_at` timestamp NULL DEFAULT NULL,
  `rejected_by` int(10) unsigned DEFAULT NULL,
  `rejection_reason` varchar(500) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  `matched_transaction_id` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_staging_user` (`user_id`),
  KEY `idx_staging_account` (`account_id`),
  KEY `idx_staging_status` (`status`),
  KEY `idx_staging_client` (`client_id`),
  KEY `idx_staging_date` (`transaction_date`),
  KEY `idx_staging_batch` (`import_batch_id`),
  CONSTRAINT `fk_staging_account` FOREIGN KEY (`account_id`) REFERENCES `accounts` (`id`) ON DELETE CASCADE,
  CONSTRAINT `fk_staging_client` FOREIGN KEY (`client_id`) REFERENCES `trust_clients` (`id`) ON DELETE SET NULL,
  CONSTRAINT `fk_staging_user` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=7427 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

